export const programmingLanguageList = [
  {
    id: 0,
    title: "JavaScript (ES6^) / TypeScript",
    fontClass: "fab fa-js-square"
  },
  {
    id: 1,
    title: "HTML5 / CSS & Sass",
    fontClass: "fab fa-html5"
  },
  {
    id: 2,
    title: "SQL",
    fontClass: "fas fa-database"
  },
  {
    id: 3,
    title: "PHP & Laravel",
    fontClass: "fab fa-php"
  },
  {
    id: 4,
    title: "C#",
    fontClass: "fab fa-microsoft"
  },
  {
    id: 5,
    title: "Java",
    fontClass: "fab fa-java"
  }
];

<ListGroup as="ul">
  <ListGroup.Item as="li" active>
    <strong>Tech</strong>
    <i className="fas fa-code-branch" />
  </ListGroup.Item>

  <ListGroup.Item action href="https://docker.com">
    Docker
    <i className="fab fa-docker" />
  </ListGroup.Item>
  <ListGroup.Item action href="https://azure.microsoft.com/en-us/">
    Azure / AWS
  </ListGroup.Item>
  <ListGroup.Item as="li">
    Jenkins / Travis
    <i className="fab fa-jenkins" />
  </ListGroup.Item>
  <ListGroup.Item action href="https://heroku.com">
    Heroku
  </ListGroup.Item>
</ListGroup>;

export const techList = [
  {
    id: 0,
    title: "Git",
    iconClass: "fab fa-github-square",
    url: "https://git-scm.com"
  },
  {
    id: 1,
    title: "Bash",
    iconClass: "fas fa-terminal",
    url: "https://www.gnu.org/software/bash"
  },
  {
    id: 2,
    title: "Linux ",
    fontClass: "fab fa-linux"
  },
  {
    id: 3,
    title: "NGINX Web Server",
    fontClass: "",
    url: ""
  },
  {
    id: 4,
    title: "C#",
    fontClass: "fab fa-microsoft"
  },
  {
    id: 5,
    title: "Java",
    fontClass: "fab fa-java"
  }
];

export default { programmingLanguageList };
